import { useMemo, useState } from "react"
import Select from 'react-select'
import countryList from 'react-select-country-list'
import "react-datepicker/dist/react-datepicker.css";
import './FifthPage.scss'
import { useNavigate } from 'react-router-dom';

const SixPage = () => {
    return (
        <div>
            <div style={{ fontSize: "20px", fontWeight: "600" }}>Authorised recipient</div>
            <div>Does the applicant authorise another person to receive written correspondence on their behalf?</div>
            <div className="check-radio-answer">
                <input class="form-check-input" type="radio" name="flexRadioDefault2" />
                <label class="form-check-label" for="flexRadioDefault1">
                    Yes
                </label>
            </div>
        </div>
    )
}
export default SixPage;
